function Contact(){
    return (
        <div className="contact">
          <h3>Contact</h3>
          <p>GitHub: <a href="https://github.com/swojas" target="_blank" rel="noopener noreferrer">Swojas</a></p>
          <p>Email: <a href = "mailto: swojas12@gmail.com">✉️</a></p>
          <a style={{textDecoration:"none", color:"black"}} href = "https://www.linkedin.com/in/swojas-bhalunkar-225a8914a/" target="_blank" rel="noopener noreferrer">LinkedIn: <i class="fab fa-linkedin"></i></a>
        </div>
    );
}

export default Contact;
